('0181538e-0135-44f0-9490-ec2e2a5cd7f8', 'Khai trương căn hộ full NT gần cầu Nguyễn Văn Cừ_Nowzone_ĐH Y Dược', '0', 'ZWI9', 'Địa chỉ: Đường Trần Hưng Đạo, Phường Cầu Kho, Quận 1, Hồ Chí Minh', '037dba23-f2f2-4dc9-8499-e6743bbe0905', 'CTCH', '[\"̛̛ ̆ ̣̂ ̛́ ̂ 100%\",\"Trần Hưng Đạo ,Q5\",\"ĐH Y Dược, ĐH Sài Gòn, Nowzone, KHTN, Ngã sáu Cộng Hoà, cầu Nguyễn Văn Cừ…\",\"̛̀ ̂́ ̛̣ - - ̣ ̃\",\"•Full nội thất - bếp riêng\",\"•Khu trung tâm qua Q1 Q3 Q10 chỉ vài phút\",\"•Hệ thống PCCC\",\"•Khu vực an ninh yên tĩnh\",\"•Dọn phòng 1 lần/ tuần\",\"•Có thang máy\",\"•Giờ giấc tự do, bạn bè thoải mái đến chơi\",\"̛ Đ̃ ̛́ ̂ ̀ ̣\",\"_____________________________\",\"ℳ.̉| Căn hộ dịch vụ, chung cư, phòng trọ cho thuê\",\"⌨️ Hotline : 039.900.8879\",\"Call, Zalo...\"]', '5001fd15-b276-4c4b-a666-e00f075d0a94', 'e1d677b0-46ed-4054-bf73-0aa8a48db9a0', '154e5565-9ea8-47a0-a7b2-40a3c5688303', '2024-08-17 19:28:52', '2024-08-17 19:28:52'),
