('090bc6c8-9cea-4712-b9c5-c7e7de91b945', 'KTX Đại Học Công Nghiệp 4 Gò Vấp free điện nước chỉ 1tr3free 100% tiền thuê tháng đầu', '5', 'ZRN4', 'Địa chỉ: 60 Đường Huỳnh Khương An, Phường 5, Quận Gò Vấp, Hồ Chí Minh', '155f86e9-9fe0-4e28-9b2f-8c49801ccb36', 'CTPT', '[\"Địa chỉ: 60/18A Huỳnh Khương An, p. 15,\",\"Gò Vấp.\",\"Không gian rộng, có cửa sổ.\",\"Trang bị giường, nệm và drap mới.\",\"Máy lạnh.\",\"Nhà vệ sinh riêng.\",\"Có bếp nấu ăn riêng trong phòng.\",\"Wifi nhanh như máy bay.\",\"Trang bị máy giặt và nơi phơi đồ.\",\"Không gian đảm bảo luôn được vệ sinh sạch sẽ.\",\"Thang máy tiện lên xuống, camera an ninh, bảo vệ 24/7.\",\"Đảm bảo điều kiện sống cho bạn một cách tốt nhất.\",\"Phòng 6 giường.\",\"Giá: 1tr3/người phòng thường.\",\"1tr5/người phòng máy lạnh.\",\"Có cho thuê phòng riêng.\"]', 'b7cf9856-d293-4331-b22a-3ea97e8c475b', 'c3c538ec-962c-47da-90b1-6dbaedfc9287', 'c59a097d-d799-4b8a-8c64-24630cd1c58b', '2024-08-17 19:44:48', '2024-08-17 19:44:48'),
('0ed115ae-1977-4dff-aa50-9b3b7361f34a', 'KTX Sinh Viên HuTech, sau lưng HUTECH, FREE100% TIỀN THUÊ THÁNG ĐẦU', '5', 'KOZ4', 'Địa chỉ: 69/38 Đường D2, Phường 25, Quận Bình Thạnh, Hồ Chí Minh', '3d660e8e-bab2-423c-8e5d-ed905761be5b', 'CTPT', '[\"VỊ TRÍ:\",\"+ Cách đại học Hutech 200m.\",\"+ Cách đại học Ngoại Thương 300m.\",\"+ Cách Đại học Giao Thông Vận Tải 350m.\",\"+ Cách đại học Hồng Bàng, Đại Học UEF 500m.\",\"Giá Thuê: 1.800.000 (trọn gói không phát sinh).\",\"Mỗi phòng Leep Box bao gồm:\",\"1, Phòng máy lạnh + quạt + quạt thông gió (sleep box có không gian riêng tư).\",\"2, Tủ quần áo (có khóa).\",\"3, Tủ đựng đồ + kệ sách (có khóa).\",\"4, Bàn học + đèn học.\",\"5, Nệm cao su + drap + rèm.\",\"KHU BẾP:\",\"1, Bếp nấu rộng rãi.\",\"2, Có đầy đủ dụng cụ: Tủ Lạnh 600L + tủ đông Chén đũa Bếp điện xoong nồi nồi cơm - Lò vi sóng...\",\"3, Bàn ăn rộng rãi, trẻ trung (mỗi tầng có thêm 1 bàn ăn ngoài hành lang).\"]', 'c234f491-3389-4377-8e45-b1e7f7c22b16', '8a3c1fc4-4a40-491b-a2cd-6411eecfe180', '58d07dce-1065-4a35-a4a5-98ff3298a4d4', '2024-08-17 19:44:48', '2024-08-17 19:44:48'),
('1456fb3c-7758-4e49-a084-98d34de0d999', 'Căn hộ full nội thất, mới toanh 100%, tại KDT Vạn Phúc City, Thủ Đức', '3', 'AFS5', 'Địa chỉ: Phường Hiệp Bình Phước, Thủ Đức, Hồ Chí Minh', 'b15ca48f-a429-4240-b603-bf9b1ce78d1f', 'CTCH', '[\"Căn Phòng full nội thất, mới toanh 100%. Tại Vạn KĐT Phúc City , Phường Hiệp Bình Phước , TP . Thủ đức\",\"- Dạng Studio Bankong: Lầu 1. Dt: 30-40m2\",\"Giá thuê : 5tr - 6,5tr/tháng\",\"Tiện ích toà nhà:\",\"- Máy giặt sử dụng free từng tầng ở giữa 2 phòng\",\"- Máy lạnh ️️\",\"- Combo bếp trên dưới cao cấp\",\"- Bangkong, cửa sổ thoáng mát\",\"- Nhà Vệ sinh cao cấp từng tầng bên ngoài ở giữa 2 phòng.\",\"- Nội thất cao cấp lắp mới theo yêu cầu.\",\"- Không giới hạn người ở\",\"- Khoá cổng vân tay\",\"- Hầm xe rộng\",\"- Không chung chủ. Giờ Giấc tự do\",\"- Xe: Free\",\"- Camera an ninh 24/24,\",\"- Tiện ích nội khu như phố Châu Âu\",\"- Hệ Thống PCCC đầy đủ\",\"Khu dẫn cư yên tĩnh , ra vào có bảo vệ giữ xe .\",\"Cách đại học luật 10p đi xe\",\"️️ Hotline : 0919.888.517 Ms Trang\"]', 'a8a65a69-a4b9-4d80-b8d3-ec10bc403dca', '667ac6bb-314d-4f11-82bf-549432cc7135', 'a0dd9058-27da-42cc-b8ed-bf571a14fa34', '2024-08-17 19:28:52', '2024-08-17 19:28:52'),
