('97a8124f-916c-4893-a566-2437793ffc9e', 'PHÒNG TRỌ ĐỐI DIỆN KS 5 SAO TÂN SƠN NHẤT MỚI XÂY RẤT ĐẸP - GẦN CÔNG VIÊN HOÀNG VĂN THỤ. GIÁ 6TR BAN CÔNG', '5', 'HNE2', 'Địa chỉ: 205/10A-B Đường Hoàng Văn Thụ, Phường 8, Quận Phú Nhuận, Hồ Chí Minh', '5889a0d3-ee43-4085-a0ff-ab11716104bb', 'CTPT', '[\"- Phòng đẹp nằm ngay trung tâm quận Phú Nhuận (xem hình thật). View trước là đối diện Khách Sạn 3* Tân Sơn Nhất, View sau là đường Nguyễn Văn Trỗi.\",\"+ Phòng mới rất đẹp được ốp lát gạch, tất cả các phòng đều có CỬA SỔ, CÓ BAN CÔNG, MÁY LẠNH, Rèm cửa. Rất thoáng mát.\",\"- Bỏ xe dưới tầng hầm, có bảo vệ trong coi, Sân thượng phơi quần áo có mái che, có 02 bộ ghế đá ngồi thư giản.\",\"- Trong nhà có Thang máy đi lại, Có Camera an ninh quan sát.\",\"- Toilet riêng, đặc biệt có BẾP nấu ăn.\",\"- Internet cáp quang lắp đặt trong phòng rất mạnh. Cáp Tivi.\",\"- Bảo vệ trong coi 24/24 giúp Bạn có cảm giác an toàn, khóa vân tay giờ giấc tự do.\",\"- Diện tích: 25m2\",\"+ Giá: 6 tr/tháng \",\"(MỜI BẠN ĐẾN XEM, CÓ BẢO VỆ DẪN BẠN XEM)\",\"+ Địa chỉ: 205/10A Hoàng Văn Thụ, P.8, Phú Nhuận, Tp. Hồ Chí Minh.\"]', 'de27c5e6-2578-4093-be46-038401fde010', '41feef16-7586-49ee-aba5-242cd3da845a', 'ecd24f88-9306-4847-8e5c-968034bfde2e', '2024-08-17 19:44:48', '2024-08-17 19:44:48'),
