('fd5304d0-d97f-4174-992f-484cb0ae482f', 'Phòng trọ dạng căn hộ mini cao cấp tại 796 Lê Đức Thọ, P.15, Quận Gò Vấp', '5', 'ZBA7', 'Địa chỉ: 796 Đường Lê Đức Thọ, Phường 15, Quận Gò Vấp, Hồ Chí Minh', '99823a18-297f-4cf5-af54-2a07e43c7d30', 'CTPT', '[\"Cho thuê căn hộ mini cao cấp tại 796 Lê Đức Thọ, Phường 15, Quận Gò Vấp, Tp. Hồ Chí Minh.\",\"Diện tích 30m2, giá 3 triệu/tháng.\",\"Có hầm giữ xe, có thang máy, giờ tự do, có bảo vệ 24/24.\",\"Wifi cực mạnh, máy nước nóng, trường hình cáp, sân tập thể dục và thư giãn. Chung cư cao cấp, an ninh tuyệt đối.\",\"Liên hệ: 0328837249 Chị Giang.\"]', '04c8ff25-cb53-4c2d-91e1-00e7ad47f588', '6a04fe4d-5ffd-4377-88e8-2db18d094578', 'a95ef42b-7ec9-4865-89c9-e80a69224591', '2024-08-17 19:44:48', '2024-08-17 19:44:48');
